%[text] %[text:anchor:T_48B9CDC7] # Color Segmentation using the L\*a\*b\* color model
%[text] This script is designed to highlight the usefulness of the L\*a\*b color for the segmentation of color images. We will also review strategies to automate color segmentation without manually tracing or clicking on objects of interest. 
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] %[text:anchor:T_969DBF63] # Strawberries, redux
%[text] Let's start with the strawberries. We were able to segment in the RGB colorspace, but we had to resort to line profiles and *maths* (difference image).
%[text] What if there was a simpler way? Let's try Lab Color Space — that's got the math baked into it. 
%[text] %[text:anchor:H_37B586C1] ## Load Image
clearvars
close all

mmSetUnitDataFolder(2) % change folder to unit2
p.name = 'strawberries.png'; % create a structure p (p for pic or photo)
p.rgb = imread(p.name) % add image to structure
imshow(p.rgb)
%%
%[text] %[text:anchor:H_19AF1996] ## Investigate using the Color Thresholder
%[text] Try the RGB ,HSV, and LAB colorspaces
colorThresholder(p.rgb)
%[text] Action
%[text] - Convert the image to HSV and LAB
%[text] - Capture the strawberries using the freehand tool
%[text] - You will have to trace several strawberries to get a good mask \
%[text] Thoughts
%[text] - RGB - very messy. Difficult to separate colors from shadows and lighting
%[text] - HSV - feasible, but perhaps not the best choice
%[text] - LAB - had the cleanest results \
%[text] Function 
%[text] - Remember to save in the MATLAB folder
%[text] - Issue - the function is not very precise or automatable
%[text] - Simply based your manual dexterity (and patience) \
%%
%[text] %[text:anchor:H_F28CAE28] ## Automate the segmentation
%[text] Instead of manually circling the strawberries until we get a good result, we can take advantage of the fact that in th Lab colorspace, colors are mathematically separated from each other.  Green and Red, in particular, are on opposites ends of the Lab color space.
%[text] ### Covert to Lab space
%[text] So, Here we convert the RGB image to a lab space image using the function **rgb2lab**
%[text] We also create a new structure, ***l,*** to keep all of our images
p.lab = rgb2lab(p.rgb)
%%
%[text] %[text:anchor:H_03ADFDCA] ### Display the L channel
%[text] In the same figure, we display the L plane and its **histogram** (not **imhist**).
figure;
nexttile
imgn = mat2gray(p.lab(:,:,1)); % normalize plane for display
imshow(imgn); 
title('L plane')
nexttile
histogram(p.lab(:,:,1))
xlabel('L intensities')
%[text] - Notice the range of L: between 0 and 100.
%[text] - L must be normalized to display properly because it has values greater than 1 and is a double \
%%
%[text] You can also correct the display by including empty brackets as the second input
clf
imshow(p.lab(:,:,1),[]); % notice the empty brackets allows us to properly display the Lab channel
%[text] - There is not a lot of contrast between the strawberries and the background
%[text] - the L plane does not appear to helpful for masking the strawberries \
%%
%[text] %[text:anchor:H_A1D4EB69] ### Display L\*a\*b channel(s) 
%[text] Here we display all Lab channels and their histograms using a FOR LOOP
clf;
tiledlayout(2,3);
p.titles = ["L (lightness)", " a (green-red)", "b (yellow-blue)"];

for n=1:3
    nexttile(n);
    imshow(p.lab(:,:,n),[]) % index out the channel and display
    title(p.titles(n));

    nexttile(n+3)
    histogram(p.lab(:,:,n))
end
%[text] - notice the varying numeric scales for each plane \
%%
%[text] The a\* plane looks promising. Recall that a\* represents the opponency between the red and green forces in our minds. 
figure;
[~,p.a] = imsplit(p.lab); % index out the a plane (2nd plane)
histogram(p.a)
hold on
xline(20,'r--')
%[text] - The histogram is bimodal (two humps)
%[text] - 20 seems to be a good threshold to separate these two groups of pixels \
%%
%[text] %[text:anchor:H_5FAE0953] ## Create mask
%[text] Create a mask that is true everywhere that *a* is greater than 21. Burn this mask into the s.rgb image and display
figure
p.aMask = p.a>15;
imshow(p.aMask)
%[text] - well, that was easy.  \
%%
%[text] %[text:anchor:H_5C7D4867] ### Compare masks
%[text] - Recreate the RG difference mask and assign to "diffMask"
%[text] - overlay on the new mask using **imshowpair** \
p.diffMask = imbinarize(p.rgb(:,:,1)-p.rgb(:,:,2));
%imshowpair
%[text] - are there differences between the masks? \
%%
%[text] %[text:anchor:H_37DEA3A9] ### Clean up a plane mask
%[text] - remove the noise on the edge of the image and the small dot
%[text] - separate the touching strawberries
%[text] - Use the function mmShowBurnImage to burn the mask into the RGB image and display \
% add morph ops - edge and small noise
% add watershed transform

figure
mmShowBurnImage(p.rgb,p.aMask)
%[text] - notice that there is some noise
%[text] - What morphological operation could help with this? \
%%
%[text] %[text:anchor:H_73C70A21] ## Change Strawberry colors using HSV
%[text] Can we use the HSV to change the color of the strawberries? We have generated comparable masks of the strawberries using two color segmentation approaches. We can use one of these masks to capture the Hue data in the H plane of the HSV-converted image. If we calculate the min and max intensities in this region, this will give us the range of Hue data that we need to change. We then can simply change all of the hues in that range to another hue. 
%[text] %[text:anchor:H_7EBA99BD] ### Convert to HSV
%[text] In this step, we just convert the RGB image to HSV and display the histogram. 
p.hsv = rgb2hsv(p.rgb); % convert to hsv
p.h = imsplit(p.hsv);
histogram(p.h)
%[text] - So, are there two peaks, or 3? \
%%
%[text] %[text:anchor:H_D0A4E47D] ### Get strawberry hues
%[text] What are the Hue values in just Strawberries? We can use the strawberry mask to index out the hue values from the H plane
clf;
histogram(p.h(p.aMask),100)
%[text] - hmm, we have peaks at the low end and high end of the hue plane.
%[text] - What's going on here? \
%%
%[text] %[text:anchor:H_7A91D19B] ### Replace strawberry hues
%[text] Remember, When we segmented the H plane, there was a circle for the histogram. So the high and end of the H values are actually continuous colors in the rainbow.
%[text] No problem. We'll just use a logical OR
% create logical array that captures these ranges
% sb_h_min = 0.9;
% sb_h_max = 0.04; % 0.031

% reset hsv
p.hsv = rgb2hsv(p.rgb); % reconvert to hsv
p.h = imsplit(p.hsv);

% replace strawberry hues
la = p.h(:,:,1) >= 0.9 | p.h <= 0.051;

p.h(la) = 0.8; % New color
p.hsv(:,:,1) = p.h;

% display results
clf
imshow(hsv2rgb(p.hsv)) % change back to rgb and show
%[text] 
%%
%[text] %[text:anchor:T_D9896EFC] # Segment Candy
%[text] For this example, we will use an image of some M&Ms to demonstrate color segmentation using the Lab color model
%[text] **END GOAL**: Create a binary image of just the M&Ms
%[text] %[text:anchor:H_53A00685] ## Load Image
%[text] Get M&Ms picture
close all % close all figures
clearvars % clear workspace
url = 'https://blogs.mathworks.com/images/steve/2010/mms.jpg'; 
p.name = 'mms.jpg'
p.rgb = imread(url);
figure;
imshow(p.rgb)
%[text] - Can we segment the M&M's?
%[text] - **Potential Problem**: lots of different colors here, plus the light brown of the table \
%%
%[text] %[text:anchor:H_207E763C] ### Explore image using Color Thresholder app
colorThresholder(p.rgb) 
%[text] To segment the M&M candies, we will create threshold values for the *a* and *b* channels. However, we can't simply circle one candy. There multiple candies with multiple color values in the a and b planes. 
%[text] So, we will need to come up with a more sophisticate thresholding techniques. Essentially, we will need multiple threshold values per plane. 
%%
%[text] %[text:anchor:H_7D545356] ## **Convert image to L\*a\*b\* space** 
%[text] %[text:anchor:H_E19460B7] First, we convert the RGB image into a LAB image using the following steps:
%[text] Convert to L\*a\*b space using the function **rgb2lab**
p.lab = rgb2lab(p.rgb);
%%
%[text] %[text:anchor:H_336F610E] ### Display L\*a\*b channels and histograms
%[text] Remember, these are not RGB planes, so the intensity values will vary wildly for each plane.
%[text] To simplify the visualization of the different planes, we input empty brackets as the second input in **imshow**.
clf
tiledlayout(2,3,"TileSpacing","tight")
p.titles = ["L (lightness)", " a (green-red)", "b (yellow-blue)"];
for n=1:3
    nexttile(n);
    imshow(p.lab(:,:,n),[]) % index out the channel and display
    title(p.titles(n));

    nexttile(n+3)
    histogram(p.lab(:,:,n))
end
%[text] Numeric Considerations
%[text] - Notice that the values in these planes are vastly different from RGB values.
%[text] - The class is double
%[text] - Lightness ranges from 0 to 100
%[text] - a and b planes range from -75 to 75, thereabouts, and are multimodal (multiple peaks in the histogram) \
%[text] Channel Appearance
%[text] - Notice how the L plane just looks like a black and white image.
%[text] -     The L plane contains the luminance info.
%[text] -     We are going to ignore that plane (it has the shadows and the shininess that causes segmentation problems).
%[text] - Notice how flat the **a** and **b** Planes look (without any shadowing) - the "color" in the M&M's is fairly consistent throughout each candy. The background is also very flat and easy to capture
%[text] - Some candies are more easily discernible in one plane compared to the other:
%[text] -     We're going to use both the a and b plane \
%%
%[text] %[text:anchor:H_D6562693] ## Segmenting the a plane
%[text] Index out the a plane and add to a new structure ***a***
a.name = "M&Ms a plane";
a.plane = p.lab(:,:,2);
%%
%[text] %[text:anchor:H_E531D9D9] ### Review the Histogram
figure 
histogram(a.plane, 50);
title('a* plane')
grid minor
%[text] - There are basically 3 peaks that we want to capture.
%[text] - We could come up with a complicated set up of Logical operations to capture these peaks, or... \
%%
%[text] %[text:anchor:H_C547FC48] ### Multi-level thresholding 
%[text] The function **multithresh** returns multiple threshold values
a.thresh = multithresh(a.plane,3)
%[text] Notice that **`mulithresh`** returns a `1x3` vector — the 3 thresholds that we asked for.
%%
%[text] %[text:anchor:H_D7A77761] ### Visualizing the Multiple Thresholds
%[text] We can visualize the results by plotting the multiple thresholds as vertical lines in the histogram for the a\* plane. 
clf
hh = histogram(a.plane, 50);
xline(a.thresh,'r--')
title('Multi-level thresholding for a*plane')
grid minor
%[text] - The three vertical lines indicate the threshold levels that were found by multithresh (-41, -10, 25)
%[text] - This effectively breaks down the image into four regions: **Region 1**: -100:-41; **Region 2:** -41:-10; **Region 3:** -10:25; **Region 4:** 25:100 \
%%
%[text] %[text:anchor:H_3DB89BEE] ## Creating a Label Matrix
%[text] A [label matrix](https://www.mathworks.com/help/images/label-and-measure-objects-in-a-binary-image.html) is similar to a binary mask, but instead of just  logical 1's and 0's, it can have a whole range of integers. Each object or region in a label matrix is labeled with the same number. 
%[text] ![](text:image:5d7e)
%[text] To create a label matrix using multiple thresholds, we use the function **`imquantize`****\*\*\*\*\*\*\*\*\*\*\*\*.** This function bins the pixel intensities in an image  based on inputted threshold values. In this case, the values from the variable ***threshes***
a.label = imquantize(a.plane, a.thresh)
fprintf('\nquant_a: \n - min: %d \n - max: %d\n',...
    min(a.label(:)), max(a.label(:)));
%[text] - `a.label` is a **label matrix**. It has a class of double, but it is made up of whole numbers ranging from 1 to 4
%[text] - notice this label matrix has the same size as the `a_plane` (just like a logical array) \
%%
%[text] %[text:anchor:H_77D05300] ### Display the label matrix
%[text] Here we display the label matrix and use a parula look up table with just 4 colors
clf;
imshow(a.label, parula(4))
ticks = 1:max(a.label(:));
colorbar('YTick', ticks, 'YTickLabel', ticks)
impixelinfo
%[text] - Notice that there are four regions in this image, labeled by 1, 2, 3 or 4
%[text] - The background is masked with the number 3
%[text] - While the candies are masked with 1,2 or 4 \
%%
%[text] %[text:anchor:H_C5BC0A9E] ## Find the Background Label
%[text] If we calculate the total area for each of the four labels in the label matrix, the largest area will be the background (green in above image). 
%[text] This is easy to calculate since the function **regionprops** accepts label matrices find the areas in a.label. Assign the output to *rp.*
rp = regionprops('table',a.label,'area')
%[text] - Notice that regionprops  treats each label as a complete entity (even if they are not contiguous).
%[text] - So, we get the total area for each of the different labels \
%%
%[text] The areas in rp are reported in order of label number. So, the *index* of the largest area will be the same as the value of the label. We can use the function `max` to find the index of the largest area, as follows:  
[~,a.background] = max(rp.Area)
%[text] - Which value in the label matrix represents the background?
%[text] - Does that match what we saw in the image? \
%%
%[text] %[text:anchor:H_0AD0E639] ## Convert the label matrix to a binary image
%[text] To calculate the properties of individual candies, we need to convert the label matrix into a binary matrix. We also want to exclude the background. To do so,  
%[text] - Perform the logical operation "Label Matrix DOES NOT EQUAL the index of the largest area".
%[text] - Assign the output to *`a.mask`*
%[text] - Display your result \
a.mask=a.label~=a.background; % not background
imshow(a.mask)
%%
%[text] %[text:anchor:H_69F369D7] ### Morphological Operations
%[text] Use morphological operations to clean up the noise in the mask 
%[text] 1. Clean up the mask using **bwareaopen** to remove noise smaller than 250 pixels
%[text] 2. Display the mask \
a.mask = bwareaopen(a.mask,250);
imshow(a.mask)
%%
%[text] The following close operation will help fill any holes in the mask
se = strel('diamond', 1); % Create the structuring element
a.mask = imclose(a.mask, se); % Fill any  holes in the connected components
imshow(a.mask)
%[text] - Your mask should look pretty good.  \
%%
%[text] %[text:anchor:H_B7B1445E] ## Which candy colors did we find in the *a* plane?
%[text] The  course function mmShowBurnImage  burns the mask into the original image and displays the burned image
figure
mmShowBurnImage(p.rgb,a.mask)
%[text] - Not bad... but we didn't get all of the candy. We're still missing the brown and blue candies \
%%
%[text] %[text:anchor:H_2A4861C1] ## Multi-threshold the b plane
%[text] The following local function recreates the step from above, but for the b plane
b = get_plane_mask(p.lab(:,:,3),"M&Ms b plane")
imshow(b.mask)
%[text] - Ok, not bad either \
%%
%[text] Still some holes, but those candy also found in the **a** plane, so we're covered
imshowpair(a.mask,b.mask)
%%
%[text] %[text:anchor:H_067F495B] ## Which candy's did we find in the b plane?
%[text] Burn the b mask into the M&M's image
mmShowBurnImage(p.rgb,b.mask)
%[text] - the red candy were not found.
%[text] - But, we found those in the red plane \
%[text] 
%%
%[text] %[text:anchor:H_A4E0FB3D] ## Combine the binary images
%[text] - Use a logical operation to combine the first and second binary images we created.
%[text] - Add your new mask tho the original ***p*** structure as p.mask
%[text] - Burn your new mask onto the original M&Ms image and display \
p.mask = a.mask | b.mask;
figure
mmShowBurnImage(p.rgb,p.mask)
%[text] - With both masks combined, you should have all of the candies \
%%
%[text] %[text:anchor:H_5016A64F] ### Thicken your masks
%[text] Notice that we don't quite have all of the candies' edges. The function **bwmorph** with an option of "thicken" will help correct that.
%[text] - burn the thickened mask onto the RGB image and display \
p.mask = bwmorph(p.mask,'thicken');
mmShowBurnImage(p.rgb,p.mask)
%%
%[text] %[text:anchor:H_59F4E4EC] ## Separate touching candies
%[text] Here we use the `mmGetWatershed` function to separate the touching candies
p.mask = mmGetWatershed(p.mask,5,ShowSteps=true)
%%
%[text] %[text:anchor:H_1891256E] ## Label Each M&M by it's color
%[text] To do this, we'll take advantage of the Hue wheel in the HSV color model 
%[text] First, we convert the M&M image into a HSV image
%[text] - Add to ***p*** as ***hsv***
%[text] - Display the three channels from the hsv image \
p.hsv = rgb2hsv(p.rgb);

figure
tiledlayout("horizontal",TileSpacing="none",Padding="tight")
titles = 'hsv';

for n=1:3
    nexttile
    imshow(p.hsv(:,:,n))
    title(titles(n))
end
%%
%[text] %[text:anchor:H_E502971C] ### Index the Hue Plane
%[text] - Index out the hue channel
%[text] - add to ***p*** as ***h*** \
p.h = p.hsv(:,:,1);
%%
%[text] %[text:anchor:H_28C59657] ## Region Properties
%[text] Next, calculate the region properties (Area and Centroid) from  ***p.mask***  and the intensity properties (Mean and Max Intensity) from the ***p.h***. Note, you do this with a single function call to regionprops
%[text] - save the region properties in **`rp`** \
rp = regionprops('table',p.mask, p.h,{'Area','Centroid','MeanIntensity','MaxIntensity','MinIntensity'})
%%
%[text] %[text:anchor:H_B75A62FC] ## Display Results
%[text] - Plot the mean hue value on each candy, as follows. \
%[text] ![](text:image:3810)
figure
imshow(p.rgb)

for n=1:height(rp)
    xy = rp.Centroid(n,:);
    text(xy(1), xy(2), sprintf('%1.2f',rp.MaxIntensity(n)),...
        'Color','w','FontWeight','bold','HorizontalAlignment','center',FontSize=9)
end
%[text] - Review the hue values
%[text] - Notice each candy has a different range but consistent color range
%[text] - For example, Blue M&M's value fall somewhere between 0.55 and 0.56.
%[text] - And, most red candies have a value higher than 0.6.  \
%%
%[text] %[text:anchor:H_B9EEEB2A] ### Histogram
%[text] - Create a histogram of the Hue values that fall inside the candy
%[text] - You'll need to index out the hue values using the candy mask \
%[text] ![](text:image:435a)
figure
histogram(p.h(p.mask))
%[text] To bin the hue values, we need the edges of the peaks. This is something we can set up manually, as follows
[0.0 0.08 0.17 0.28 0.5 0.65 1.0]
%%
%[text] %[text:anchor:H_ADDA2386] ## Label Hue values
%[text] Here we use the function **discretize** to create categories for each range of values using the Hue Edge values from above.  We manually enter the color names to reflect discretized values.
rp.Color = discretize(rp.MeanIntensity,[0.0 0.08 0.17 0.28 0.5 0.65 1.0], ...
    'categorical',{'orange','yellow','brown','green','blue','red'})
%[text] - Notice that we now have a new column to the ***rp*** table called Color that contains a categorical array of colors \
%%
%[text] Label each candy with their color, as follows
figure
tiledlayout("horizontal","TileSpacing","none","Padding","tight")
ax = gobjects(3);
ax(1)=nexttile; 
imshow(p.rgb)
for n=1:height(rp) % label with color name
    xy = rp.Centroid(n,:);
    text(xy(1)-10, xy(2), string(rp.Color(n)),'Color','w','FontWeight','bold','FontSize',9)
end
%[text] - Works amazingly well
%[text] - But not perfect. Some mislabeled \
%%
%[text] Here are some more labeled images for reference
%[text] - Can you see why the candies may have been mislabeled? \
ax(2) = nexttile;
imshow(p.rgb)

for n=1:height(rp)
    xy = rp.Centroid(n,:);
    text(xy(1), xy(2), sprintf('%1.2f',rp.MeanIntensity(n)),...
        'Color','w','FontWeight','bold','HorizontalAlignment','center',FontSize=9)
end

ax(3) = nexttile;
imshow(p.h)
linkaxes(ax,'xy')
%[text] - HSV color models have the same color separation issues that RGB images have. 
%[text] - We'll return to this problem when we explore more sophisticated mathematical techniques to separate colors in the Segmentation by Distance Live script.  \
%%
%[text] %[text:anchor:T_511EB36B] # Local Functions
function s = get_plane_mask(plane,name)
s.name = name;
s.plane = plane;
s.thresh = multithresh(plane,3);
s.label = imquantize(plane,s.thresh);
rp = regionprops('table',s.label,'area');
[~,s.background] = max(rp.Area);
s.mask = s.label ~= s.background;
s.mask = bwareaopen(s.mask,250); % remove any small noise
se = strel('diamond', 1); % Create the structuring element
s.mask = imclose(s.mask, se); % Fill any  holes in the connected components
end

function labelThemMM(p,rp)
imshow(p.rgb)
for n=1:height(rp)
    xy = rp.Centroid(n,:);
    text(xy(1), xy(2), num2str(n),'Color','w','FontWeight','bold','HorizontalAlignment','center')
end
fprintf('%d M&M''s found!\n',height(rp))
end


